import Carousel, { Dots } from '@brainhubeu/react-carousel';
import styled from 'styled-components';
import ImgSlider from './imgSlider';

const Styled = styled.section`
  width: 100%;
  height: 300px;
  margin: 5em 0;
  overflow-x: hidden;

  ul {
    display: flex;
    li {
      flex-shrink: 0;
      height: 300px;

      img {
        height: 100%;
        object-fit: cover;
      }
    }
  }

  .img--slider {
    /* flex-shrink: 0; */
    display: inline-block;
    height: 100%;
    width: 300px;
    margin: 2em 1em;
  }
`;

const Carousell = () => {
  const imgs = {
    0: '/burger.jpg',
    1: '/craft_beer.jpg',
    2: '/drink_pink.jpg',
    3: '/SimonesBarFaceS.jpg',
    4: '/PinballBooth.jpg',
    5: '/pizza.jpg',
    6: '/patio.jpg',
    7: '/santi.jpg'
  };

  return (
    <Styled className='carousel'>
      <Carousel>
        {Object.values(imgs).map((img, i) => (
          <img key={i} src={img} alt='img' />
        ))}
      </Carousel>
    </Styled>
  );
};

export default Carousell;
